import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'

class App extends React.Component {
    render() {
        return (
            <div className="main">
                <div className="todo">
                    <h1>TODO</h1>
                </div>
                <button  className="plusBtn">+</button>
            </div>
        );
    }
}

ReactDOM.render(<App /> ,document.getElementById('root'));
